import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const NavbarContainer = styled.nav`
  background-color: #4e6eff;
  color: #ffffff;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 1rem;
`;

const LogoLink = styled(Link)`
  color: #ffffff;
  font-size: 1.5rem;
  text-decoration: none;
`;

const UserContainer = styled.div`
  display: flex;
  align-items: center;
`;

const ProfilePic = styled.img`
  width: 30px;
  height: 30px;
  border-radius: 50%;
  margin-right: 0.5rem;
`;

const Username = styled.span`
  font-weight: bold;
`;

const Navbar = () => {
  // Replace these with actual user data from your app's state or context
  const user = {
    username: 'john_doe',
    profilePicture: 'https://example.com/profile-pic.jpg',
  };

  return (
    <NavbarContainer>
      <div>
        <LogoLink to="/">Social Media App</LogoLink>
      </div>
      <UserContainer>
        <ProfilePic src={user.profilePicture} alt="User Profile" />
        <Username>{user.username}</Username>
      </UserContainer>
    </NavbarContainer>
  );
};

export default Navbar;
